import React from 'react';
import './input-img.module.scss'

function InputImg() {
  return (
    <fieldset className="input-img">
      <div className="input-img__wrapper">
        <label>
            <input 
                className="input-img__input"
                type="file"
                name="img"
                accept="image/png, image/jpeg"
            ></input>
            <span className="input-img__label">сменить фото</span>
        </label>
      </div>
    </fieldset>
  );
}

export default InputImg;
